# base64解码
# base64信息 （b64解码→）  二进制   (utf-8→)   人看到的信息
import base64

base64_encoded = '5Lit5Zu9'
content_bytes = base64.b64decode(base64_encoded)
print(content_bytes)        # b'\xe4\xb8\xad\xe5\x9b\xbd'
content = content_bytes.decode(encoding='utf-8')      # 中国
print(content)



# 示例2   base64图片信息转本地图片
base64_img = ''
content_bytes = base64.b64decode(base64_img)
with open('10write.jpg','wb') as f:
    f.write(content_bytes)
